import UIKit

public extension UIViewController {
    func hideKeyboardWhenTappedAround() {
        let tap: UITapGestureRecognizer = UITapGestureRecognizer(target: self, action: #selector(UIViewController.dismissKeyboard))
        tap.cancelsTouchesInView = false
        view.addGestureRecognizer(tap)
    }
    
    @objc func dismissKeyboard() {
        view.endEditing(true)
    }
}

class ViewController: UIViewController, UITableViewDataSource, UITableViewDelegate, UISearchBarDelegate {

    @IBOutlet weak var searchBar: UISearchBar!
    @IBOutlet weak var tableView: UITableView!
    
    var searchActive : Bool = false
    var filtered:[String] = []
    
    override func viewDidLoad() {
        super.viewDidLoad()
        
        // Do any additional setup after loading the view, typically from a nib.
        tableView.delegate = self
        tableView.dataSource = self
        searchBar.delegate = self
        
        tableView.separatorColor = .clear
        
        self.hideKeyboardWhenTappedAround()
    }    
    
    override func didReceiveMemoryWarning() {
        super.didReceiveMemoryWarning()
        // Dispose of any resources that can be recreated.
    }
    
    func searchBarTextDidBeginEditing(_ searchBar: UISearchBar) {
        searchActive = true;
    }
    
    func searchBarTextDidEndEditing(_ searchBar: UISearchBar) {
        searchActive = false;
    }
    
    func searchBarCancelButtonClicked(_ searchBar: UISearchBar) {
        searchActive = false;
    }
    
    func searchBarSearchButtonClicked(_ searchBar: UISearchBar) {
        searchActive = false;
    }
    
    func searchBar(_ searchBar: UISearchBar, textDidChange searchText: String) {
        filtered = data.filter({ (text) -> Bool in
            let tmp: NSString = text as NSString
            let range = tmp.range(of: searchText, options: NSString.CompareOptions.caseInsensitive)
            return range.location != NSNotFound
        })
        if(filtered.count == 0){
            searchActive = false;
        } else {
            searchActive = true;
        }
        self.tableView.reloadData()
    }
    
    func numberOfSectionsInTableView(tableView: UITableView) -> Int {
        return 1
    }
    
    func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        if(searchActive) {
            return filtered.count
        }
        return EmojiOne.count
    }
    
    func tableView(_ tableView: UITableView, heightForRowAt indexPath: IndexPath) -> CGFloat {
        return 110.0
    }
    
    func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        let cell = tableView.dequeueReusableCell(withIdentifier: "cell") as! IconTableViewCell
        var emoji: EmojiOne
        
        cell.smallIcon.image = nil
        cell.mediumIcon.image = nil
        cell.largeIcon.image = nil
        
        if(searchActive){
            cell.iconName.text = filtered[indexPath.row]
            emoji = EmojiOne(rawValue: data.index(of: filtered[indexPath.row])!)!
        } else {
            cell.iconName.text = data[indexPath.row];
            emoji = EmojiOne(rawValue: indexPath.row)!
        }
        
        cell.smallIcon.setEmoji(emoji: emoji)
        cell.mediumIcon.setEmoji(emoji: emoji)
        cell.largeIcon.setEmoji(emoji: emoji)
        
        return cell
    }
    
    override func prepare(for segue: UIStoryboardSegue, sender: Any?) {
        if segue.identifier == "showIcon" {
            let indexPath = tableView.indexPathForSelectedRow
            
            let vc = segue.destination as! IconViewController
            var emoji: EmojiOne
            
            if(searchActive){
                emoji = EmojiOne(rawValue: data.index(of: filtered[(indexPath?.row)!])!)!
            } else {
                emoji = EmojiOne(rawValue: (indexPath?.row)!)!
            }
            
            vc.emoji = emoji
        }
    }
    
